import React from 'react'

export default function Button(props) {
  return (
    <div>
      <div className="btn mt-2 flex  flex-col space-y-4 md:space-y-0  md:flex-row md:justify-center ">
                <div className="flex flex-r"></div>
          <button className="button1 text-xl font-semibold text-gray-100  mx-auto p-2  w-11/12 md:w-1/3 bg-sky-400 hover:bg-sky-500 rounded-2xl">{props.first}</button>
          <button className="button2 text-xl font-semibold text-gray-100 mx-auto p-2   w-11/12 md:w-1/3 bg-sky-400 hover:bg-sky-500 rounded-2xl ">{props.second}</button>
        </div>
   
    </div>
  )
}
